import react from 'react';
import { Link } from 'react-router-dom';

const MobileMenu = ({ mobileMenu }) => {
    return mobileMenu && (
        <div class="mobile-menu">
            <ul class="button">
                <li><Link to="/calculator">Calculator</Link></li>
		        <li><Link to="/rates">Rates</Link></li>
            </ul>
        </div>
    )
}

export default MobileMenu;
